217.source:
function setTarget(object) {
    this.target = object || {};
    if (!this.target.__evaluator) {
        var evaluator = new lively.bindings.FRPCore.Evaluator();
        evaluator.installTo(this.target);
        evaluator.setSyncWithRealTime(true);
    }
    this.keys = this.keysFor(this.target);
    this.setList();
    this.updateSourcePane();
    this.get("EvalPane").doitContext = this.target;
    this.startStepping(500, "updatePanes");
}

220.source:
function updatePanes() {
    var keys = this.keysFor(this.target);
    if (!this.keys.equals(keys) || this.forceSourceUpdate) {
        this.keys = keys;
        this.setList();
    }
    this.updateValuePane();
}

