function acceptSource(aString) {
    if (this.selected) {
        var val = lively.bindings.FRPCore.EventStream.fromString(aString);
        val.installTo(this.target, this.selected);
    } else {
        lively.bindings.FRPCore.EventStream.updateStreamsIn(this.target, aString);
    }
    this.target.__evaluator.sortAndMaybeEvaluate();
    this.forceSourceUpdate = true;
    this.forceValueUpdate = true;
    this.updateSourcePane();
    this.updatePanes();
}

