function updateValuePane() {
    var pane = this.get("ValuePane");
    var sel = this.selection();
    var str = this.selected ? this.valueString(sel) : this.valueSummary();
    if (pane.getSelectionRange() === null || this.forceValueUpdate) {
        this.forceValueUpdate = false;
        pane.textString = str;
    }
}

238.source:
function valueString(obj) {
    return Objects.inspect((this.isEventStream(obj)
        ? obj.currentValue
        : obj), {maxDepth: 1});
}

241.source:
function setSelection(val) {
    if (this.selected) {
        var obj = this.selection();
        if (this.isEventStream(obj)) {
            obj.frpSet(val, Date.now());
        } else {
            this.target[this.selected] = val;
    }
}
}

