function sourceSummary() {
    var str = new StringBuffer();
    this.keys.forEach(function(k) {
        str.nextPutAll(Strings.format('%s %s %s\n', k,
            (this.isEventStream(this.target[k]) ? '<-' : '= '),
            this.sourceString(this.target[k])));
        }.bind(this));
    return str.contents();
}

