function addField() {
    this.world().prompt("The name of new field?", function(name) {
        if (name) {
            var strm = new lively.bindings.FRPCore.EventStream().value().finalize([]);
            strm.installTo(this.target, name);
            this.target.__evaluator.sortAndMaybeEvaluate();
            this.updatePanes();
        }
    }.bind(this));
}
